import tensorflow as tf

class MyMLP(tf.keras.Model):

  def __init__(self):
    super(MyMLP, self).__init__()
    #definição das camadas dentro do construtor da classe
    self.dense1 = tf.keras.layers.Dense(5, activation=tf.nn.tanh)
    self.dense2 = tf.keras.layers.Dense(2, activation=tf.nn.tanh)
    self.dense3 = tf.keras.layers.Dense(40, activation='softmax') # Quantidade de classes de solo


  def call(self, inputs):
    #comportamento das camadas para processar o vetor de entrada dentro da função call
    x = self.dense1(inputs)
    x = self.dense2(x)
    x = self.dense3(x)
    return x

#inicialização da rede com pesos aleatórios
